#!/usr/bin/env python
# docker build -f setup.Dockerfile -t setup .
# docker run -i -t setup

import requests
import json
import argparse
import logging

def parse_args():
    parser = argparse.ArgumentParser(
      description='Create sample data on a development instance of the API')
    parser.add_argument("--verbose", "-v", action="store_true", help="Turn on debug logging")
    parser.add_argument("--quiet", "-q", action="store_true", help="Turn off logging")

    parser.add_argument("--docker", action="store_const", dest="base_url",
      const="http://host.docker.internal:8080")
    parser.add_argument("--local",  action="store_const", dest="base_url",
      const="http://localhost:8080")
    parser.add_argument("--base-url",  action="store", dest="base_url")
    return parser.parse_args()

args = parse_args()
api = args.base_url

if args.verbose:
  if args.quiet:
    print("Incompatible options: --verbose and --quiet")
    exit(1)
  logging.basicConfig(level="DEBUG")
elif args.quiet:
  pass
else:
  logging.basicConfig(level="INFO")

if api is None:
  logging.error("No API location found")
  exit(1)
else:
  logging.info("API is located at %s", api)

# setup session
browser = requests.session()
browser.allow_redirects = False

def login(user):
  browser.auth = (user, user)
  # login user
  current_user = browser.get(url=api + "/api/users")
  print("User Response: " + str(current_user.status_code))
  print("Logged in as " + current_user.json()["name"])

login("admin")
# set csrf token
csrf_info = browser.get(api + "/csrf").json()
browser.headers[csrf_info['headerName']] = csrf_info['token']

def create_attachment_subtype(name, tag, attachment_type, description, url_template):
  data = {
    "name": name,
    "tag": tag,
    "forAttachmentType": attachment_type,
    "description": description
  }
  if (url_template):
    data["urlTemplate"] = url_template

  response = browser.post(
    url=api + "/resources/attachmentSubtypes",
    data=json.dumps(data)
  )

  print(name + " response: " + str(response.status_code))

create_attachment_subtype("Trouble Ticket", "troubleticket", "LINK", "trouble ticket subtype", "http://tickets.example.com/ticket/%s/details")
create_attachment_subtype("Assignee", "assignee", "TAG", "The assignee the case is assigend to", None)
create_attachment_subtype("Field Office", "fieldoffice", "TAG", "The Field office the case is assigend to", None)
create_attachment_subtype("Referral", "referral", "TAG", "The reason for a referal", None)

def create_case_management_system(name, application_url, description, tag, case_details_url_template):
  data = {
    "name": name,
    "applicationUrl": application_url,
    "description": description,
    "tag": tag,
    "caseDetailsUrlTemplate":case_details_url_template
  }

  response = browser.post(
    url=api + "/resources/caseManagementSystems",
    data=json.dumps(data)
  )

  print(name + " response: " + str(response.status_code))

create_case_management_system("DEFAULT", "http://default.my-agency.example.gov", "Fictional System for tests and demos.", "DEFAULT", "http://default.my-agency.example.gov/cases?case=")
create_case_management_system("OTHER", "http://legacy-system.my-agency.example.gov", "Empty system for tests and demos.", "OTHER", "http://archives.my-agency.example.gov/casedetails/")

def create_case_type(name, description, tag):
  data = {
    "name": name,
    "description": description,
    "tag": tag,
  }

  response = browser.post(
    url=api + "/resources/caseTypes",
    data=json.dumps(data)
  )

  print(name + " response: " + str(response.status_code))

create_case_type("Standard Case", "The type of case that is loaded for tests and demos.", "STANDARD")
create_case_type("Non-standard Case", "The type of case that is loaded for tests and demos but isn't standard.", "WEIRD")

login("service")


